import ListGroup from "react-bootstrap/ListGroup";

const MisList = ({ mis, solInsts }) => {
  return (
    <>
      <ListGroup as="ul">
        {JSON.parse(mis).length === 0
          ? "No"
          : JSON.parse(mis).map((mis) => (
              <ListGroup.Item as="li" key={mis.id}>
                Name: {mis.name} <br />
                Solidarity Institution:
                {solInsts.filter((x) => x.id === mis.solInstId)}
              </ListGroup.Item>
            ))}
      </ListGroup>
    </>
  );
};

export default MisList;
